import React from 'react';
import IndiaChart from '../Charts/IndiaCases'

function show() {
    ReactDOM(<IndiaChart />, document.getElementById('root'));
}

function IndiaButton() {

    return (
        <button type="button" class="btn btn-outline-primary" onClick={ show() }>India</button>
    )
}

export default IndiaButton;
